import React from "react";
import OrangeBorder from "../../../shared/OrangeBorder";
import "./index.scss";

function CartTotals() {
  return (
    <div className="cart-totals">
      <OrangeBorder>
        <h3 className="widget-heading">Cart totals</h3>
        <table>
          <tbody>
            <tr>
              <td>Cart Subtotal</td>
            </tr>
            <tr>
              <td>Order total</td>
            </tr>
          </tbody>
        </table>
      </OrangeBorder>
    </div>
  );
}

export default CartTotals;
